import React from 'react'
import './MainLogin.css';

function MainLogin () {
  return (
    <div className="mainLogin">

        <h2>UserName</h2>
        <input placeholder="Ex: toto"  type="text" ></input>
        <h2>Password</h2>
        <input placeholder="Ex: 123.."  type="password" ></input>
        <btn>
          Login
        </btn>
        
    </div>
  )
}

export default MainLogin;
